import React, { Component } from 'react';
import RollDice from './RollDice';
import './Dice.css';

class Dice extends Component {
  constructor(props) {
    super(props);
    this.state = {
      num: 'one',
      num2: 'two'
    };
  }

  render() {
    return (
      <div className="container">
        <i className={`fas fa-dice-${this.state.num}`}></i>
        <i className={`fas fa-dice-${this.state.num2}`}></i>
        <RollDice state={this.state} />
      </div>
    );
  }
}
export default Dice;
